#include <iostream>
#include <string>

using namespace std;

string removeDuplicates(string s) {
    int j = 0;
    for(int i=1;i<s.length();i++){
        while(s[i] != s[j]){
            i++;
            j++;
            if(i>s.length()){
                return s;
            }
        }
        int remLen = i-j+1;
        s.erase(j, remLen); 
        // cout << s << endl;
        j = 0;    
        i = 0;
    }
}

int main(){
    string s = "";
    cout << removeDuplicates(s);
    
}